{"type":"text","text":"{
  "name": "Notre-Dame Cathedral of Paris",
  "formatted_address": "6 Parvis Notre-Dame - Pl. Jean-Paul II, 75004 Paris, France",
  "location": {
    "lat": 48.85296820000001,
    "lng": 2.3499021
  },
  "formatted_phone_number": "01 42 34 56 10",
  "website": "https://www.notredamedeparis.fr/",
  "rating": 4.7,
  "reviews": [
    {
      "author_name": "Douglas Shin",
      "author_url": "https://www.google.com/maps/contrib/107572007472804734737/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXR0BaGFx98iLcsuZiPq74timJnfshLfX0g8i_WT8Y02kXsCFaa=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "3 weeks ago",
      "text": "If you’re in Paris, you can’t miss this place. Notre-Dame Cathedral is over 850 years old and one of the most iconic examples of French Gothic architecture. Construction started in 1163 and took nearly 200 years to complete. It has witnessed many key events in French history, including the coronation of Napoleon and Victor Hugo’s famous novel The Hunchback of Notre-Dame that helped save the cathedral.\n\nWhen I visited in the morning, I was honestly surprised by how crowded it already was. But despite the people, the stunning architecture completely mesmerized me. The details of the facade, the giant rose windows, and the impressive scale are unforgettable.\n\nHighly recommended for anyone interested in history, architecture, or photography!",
      "time": 1751431535,
      "translated": false
    },
    {
      "author_name": "Tom Grusz",
      "author_url": "https://www.google.com/maps/contrib/109105906140214486593/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjX8RyKkwS4w7W9M10CUFYtiMzQK5epb672PfnwX9OUCII_qpJs=s128-c0x00000000-cc-rp-mo-ba2",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "Definitely a must have sight to check out when visiting Paris. After the restoration it’s incredible. The queue can get quite long, so buy tickets in advance if you can. Although, if you’re a young European you can get free access. Don’t forget to dress appropriately and keep silence. The view is amazing, you can view most of the site included in your ticket (without the treasury). There are places exclusive for praying and should not be photographed. There are a few gift shops and coin vending machines, and you can also donate. You can pay through card.",
      "time": 1752874111,
      "translated": false
    },
    {
      "author_name": "Holly Spinelli",
      "author_url": "https://www.google.com/maps/contrib/116248548726356352504/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXdQjGs4B_0NcWbMut5K1MXDHUacyM-4xGLQy624HGTQM7z_wTu1Q=s128-c0x00000000-cc-rp-mo-ba3",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "Stunning! The work to restore this breathtaking cathedral is incredible! We reserved our tickets for 9:15 am and we were able to walk right in. No long wait here. We recommend paying the extra 12 euros for viewing the rooms with the extra artifacts. We had a wonderful time.",
      "time": 1753169381,
      "translated": false
    },
    {
      "author_name": "Ivan Tan",
      "author_url": "https://www.google.com/maps/contrib/117991758272607395005/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVQN1wJ5Ewsincc-Xu-JNLsgh6U1zdgI6-dyxiQ-9Wo-2GDD_dB=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "Be ready for crowds when you visit Notre-Dame, it was super crowded when I went. The good thing is, you don’t need a ticket or reservation. Just join the line and wait your turn. It can take a while, but it’s definitely worth it.\n\nConstruction started way back in 1163 and took nearly 200 years to finish. Walking inside feels like stepping back in time. One noteworthy thing is that the roof was built with wooden beams instead of stone, like many later cathedrals. That’s actually why the roof burned so fast during the big fire in 2019, it was mostly ancient wood, which caught fire quickly.\n\nIf you look up at the roof, you’ll see those little stone creatures called gargoyles. They’re not just creepy decorations. Some of them work as water spouts to direct rain away from the walls, and others were thought to scare off evil spirits. Either way, they’re super cool and make great photos.\n\nOverall, I think Notre-Dame is a must-visit if you’re in Paris. It’s full of history, beauty, and a special spiritual feeling. Even after the fire, it’s still an amazing place to see. I’m definitely planning to go back once the restoration is fully finished so I can see it in all its glory again.",
      "time": 1750833701,
      "translated": false
    },
    {
      "author_name": "B",
      "author_url": "https://www.google.com/maps/contrib/113727681798459764615/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLCZBmpNhVXwxrgtL3XrL5VzC870tT5JieX4BURurXmWjA3llQ=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "One of the most incredible places, especially when you consider the restoration that’s taken place. We didn’t book in advance but got there pretty early (around 9am), we walked straight in. Be prepared that shoulders have to be covered with something opaque, I saw some people who had brought translucent covers for their shoulders and they were being turned away. I’d highly recommend a visit if you get chance.",
      "time": 1752940028,
      "translated": false
    }
  ],
