{"type":"text","text":"{
  "name": "Panthéon",
  "formatted_address": "Pl. du Panthéon, 75005 Paris, France",
  "location": {
    "lat": 48.8462218,
    "lng": 2.3464138
  },
  "website": "https://www.paris-pantheon.fr/",
  "rating": 4.6,
  "reviews": [
    {
      "author_name": "Ivan Tan",
      "author_url": "https://www.google.com/maps/contrib/117991758272607395005/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVQN1wJ5Ewsincc-Xu-JNLsgh6U1zdgI6-dyxiQ-9Wo-2GDD_dB=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "This is a stunning historic building originally built as a church but now serves as a mausoleum for famous French figures like Voltaire, Rousseau, and Marie Curie. It’s known for its impressive neoclassical architecture and its huge dome. Inside, you can see the Foucault pendulum demonstrating Earth’s rotation. It’s a cool spot to learn about France’s history and see some beautiful design.",
      "time": 1752340575,
      "translated": false
    },
    {
      "author_name": "Helena",
      "author_url": "https://www.google.com/maps/contrib/104895466286457601050/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLPPLNjLfPhWdY4Glf_JxVNgv5aZiOQjb1ohftrg7v6koEORyM=s128-c0x00000000-cc-rp-mo-ba3",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "An absolutely stunning and sacred experience. I almost skipped it and wow would I have been a sucker. The building is stunning in its grandeur, and the chambers were quite moving to visit.",
      "time": 1752950410,
      "translated": false
    },
    {
      "author_name": "sara naccour",
      "author_url": "https://www.google.com/maps/contrib/100675507700205673863/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjViDURTTPOHhTU3ODxhFNz8hX7ftV1PArwblrYqILAHU5Yx4h4V=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "The Panthéon in Paris is such a beautiful and impressive place to visit. The architecture is stunning, and the whole area around it is peaceful and quiet — perfect for a relaxing walk. Everything was very clean and well maintained. A wonderful spot to take in some history and enjoy the calm atmosphere in the heart of the city.",
      "time": 1749889726,
      "translated": false
    },
    {
      "author_name": "Mike Seitz",
      "author_url": "https://www.google.com/maps/contrib/101698742365670859006/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocI0wHpAsyJ3y8piZN25JQnMyuCvpLHjmlOQ4MUGykGtmaGNYA=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "Started off as a Basilica, turned into monument for the French Revolution.\n\nWalking in you can tell it used to be a church, but you then start seeing monuments to various people and ideas not associated with the Church.\n\nThe crypt is the resting place of influential and significant contributors to French identity. Victor Hugo, Marie Curie, Voltaire, etc...",
      "time": 1752346669,
      "translated": false
    },
    {
      "author_name": "Vaughan Fleischer",
      "author_url": "https://www.google.com/maps/contrib/101538670945960251973/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVu5mqhTV1NeI49-37twGVxxYlx1CBSmTvusIUVbv0Zykg4Zr7bEA=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 4,
      "relative_time_description": "a month ago",
      "text": "An amazing experience. The most powerful.images describing so much life. The sculptures are beyond imagining. The crypt was deafening in its solemnity. Very interactive with audio guide. Very easy to use. There was some singing that was played and it was mesmerizing. I saw the Notre Dame and St Michelle and truly this was one of my top experiences. Bathrooms facilities easily found. Wheelchair access. Very friendly staff.",
      "time": 1750278564,
      "translated": false
    }
  ],
