{"type":"text","text":"{
  "name": "Louvre Museum",
  "formatted_address": "75001 Paris, France",
  "location": {
    "lat": 48.8606111,
    "lng": 2.337644
  },
  "formatted_phone_number": "01 40 20 53 17",
  "website": "https://www.louvre.fr/",
  "rating": 4.7,
  "reviews": [
    {
      "author_name": "Urša Pelicon",
      "author_url": "https://www.google.com/maps/contrib/109443327292800318791/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWg70Cm0yFwzxLVQjtEfHS-dUb5Wuc0D2QexzMP4YjeL2qv0fA-=s128-c0x00000000-cc-rp-mo-ba3",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "Definitely buy tickets in advance. If you are a student in the EU under 26, you can get in for free (you still need a reservation). Don't forget your student ID card!\n\nThe museum was very crowded, but that's to be expected. Don't expect you'll see the Mona Lisa up close. If you want to snap a quick photo of it, you can take one of the paths on the side, but you are not allowed to stop, so you have to do it while walking.\n\nThe rest of the most famous works were not as crowded, so you could get to the front row quickly. Just don't expect to get a picture without other visitors in the frame.\n\nWe had a reservation for 13:30 and ended up entering around an hour later. If you are a quick walker, that might be enough time, but it sadly wasn't enough for us.\n\nThe giftshop and the bookstore closes at 18:30. The staff was very helpful. If the line at the checkout is too long, there are more registers upstairs in the bookstore section.",
      "time": 1753174692,
      "translated": false
    },
    {
      "author_name": "Quang Hải Trương",
      "author_url": "https://www.google.com/maps/contrib/113537969869681982663/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLqaL9qymH_RcpY-LziGPHXcHzL0sJuGrTeaSKBW63rA1FpLHo4=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 4,
      "relative_time_description": "a week ago",
      "text": "Very elegant and classy collection of arts, though it definitely focus more in the arts side than, let's say, British Museum. Initially a fortress in Medieval Ages, now Louvre Museum still keeps some of its original wall and has some coffee, restaurants, library, bookshops and shopping centre inside it, a perfect mix between classical and modern values. The only minus point is that Exit route can be really confused at times.",
      "time": 1753047371,
      "translated": false
    },
    {
      "author_name": "Bartłomiej Wypych",
      "author_url": "https://www.google.com/maps/contrib/101000668711652580032/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVMdkJC26yTQKD32S3FF77NaRLX5TUGDub-XcD6Z5EaL1RNN0o=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "I was only outside the main building, so my opinion is not comprehensive. Beautiful architecture, not too much crowd, and.... terrible heat from which I was protected by sunscreen. One of those iconic buildings in Paris that should be on every visitor's list. Ramps for the disabled are located in several places.",
      "time": 1752424135,
      "translated": false
    },
    {
      "author_name": "M Raposo",
      "author_url": "https://www.google.com/maps/contrib/117419056979165956649/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVACyvHob1vxEH6_CnblEmr95TPU-94LUuXlE5-CFJV-7bayq2GGw=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "Come early and be prepared to spend the day, even then you won't be able to experience everything g offered at one of the greatest museums I've ever experienced. But tickets in advance, sit down at the shop with a map and a coffee and plan out your day, it's a maze, but even if your list you're still pretty content as every corner has something amazing in it",
      "time": 1752412851,
      "translated": false
    },
    {
      "author_name": "Mike Reall",
      "author_url": "https://www.google.com/maps/contrib/111450182534058193736/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUDO9vQHx0WRRqOwgmlvpwbDijYT1nLDD8mu0S9pSNkYfzgbpY4Gw=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "A lot of amazing exhibits. The building itself is also pretty cool. Try to arrive early if you want to get through must of the exhibits. We arrived in the afternoon and could only get through a few.\n\nIf you want to see the Mona Lisa, go directly to the Denon section. The signs take you through the sync your all around the museum.",
      "time": 1752160696,
