{"type":"text","text":"{
  "name": "Musée d'Orsay",
  "formatted_address": "Esplanade Valéry Giscard d'Estaing, 75007 Paris, France",
  "location": {
    "lat": 48.8599614,
    "lng": 2.3265614
  },
  "formatted_phone_number": "01 40 49 48 14",
  "website": "https://www.musee-orsay.fr/fr",
  "rating": 4.8,
  "reviews": [
    {
      "author_name": "Ivan Tan",
      "author_url": "https://www.google.com/maps/contrib/117991758272607395005/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVQN1wJ5Ewsincc-Xu-JNLsgh6U1zdgI6-dyxiQ-9Wo-2GDD_dB=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "I'm using Paris Museum Pass, just join the line via Entrance C.\n\nThis is one of the coolest art museums in Paris, it’s a must-visit if you’re Van Gogh's fan or simply into art. What makes it really special is that the building itself used to be a huge train station, it was the Gare d’Orsay, built around the early 1900s. Instead of tearing it down, they turned it into a museum, which means you get this amazing mix of old industrial architecture and art all in one place.\n\nInside, the museum is packed with incredible artworks, mostly from the late 19th and early 20th centuries. You’ll find tons of famous Impressionist and Post-Impressionist paintings here, artists like Monet, Degas, Renoir, Van Gogh, and Cézanne. If you love those bright, colorful paintings or want to get a feel for the art that changed the world, this is the spot.\n\nBesides paintings, the museum also has sculptures, decorative arts, and photography. It’s pretty manageable in size, so you don’t get overwhelmed like in some bigger museums.\n\nThe museum sits right on the left bank of the Seine, close to the Louvre and the charming Saint-Germain area. So, it’s easy to fit it into a day of exploring Paris.\n\nIt's recommended to visit here. :)",
      "time": 1750956479,
      "translated": false
    },
    {
      "author_name": "Traveling G's",
      "author_url": "https://www.google.com/maps/contrib/111865369886582280285/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWP5fBsRfhZU1th3yrsWRiIjto0i2B0sma9MtzT-4-hiTp2iiY=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "3 weeks ago",
      "text": "A wonderful collection of art from the time of the invent of the camera forward.  The Orsay Museum houses some of the world's most treasured art pieces.\n\nFrom Monet, Gauguin, Manet, Renoior to Van Gogh and so many more.  Paintings and sculptures abound in the former train station.  A half-day should be the minimum amount of time spent in the great halls of the Orsay.  My last visit we elected to use a self-guided audio tour and enjoyed every step.\n\nThe Dance at the Moulin De La Galette by Renoir is my current favorite.  Degas' multi-texture sculpture Petite danseuse de quatorze ans is another favorite.\n\nThe Orsay is along the Seine near many other stops that I like to make when in the area.  Stroll along the river and take in the magazine stands and vendors.  Maybe a river tour starting from Pont Neuf.  With a little time left in your day the Luxembourg Gardens and the Shakespeare and Co Bookstore are easy additions to your afternoon trek.\n\nWhile I might prefer the Louvre or the Vatican overall as a museum...the Orsay has so many great works of art it should be included on your itinerary.  Definitely, something for everyone on this side of the Seine.",
      "time": 1751565982,
      "translated": false
    },
    {
      "author_name": "Sorina C. Susnea",
      "author_url": "https://www.google.com/maps/contrib/100015387415535364362/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWSL1kXBS9glZWklMrpfReEe-rIrQXDlsOu8e6mzPSQXk3hJMLt=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "in the last week",
      "text": "I absolutely loved the Musée d’Orsay in every way. I'm still processing the incredible experience— the art, its history, and the vibrant energy that fills the space. The best part was that, even during my 3–4 hour visit, it never felt overwhelming like some other large museums.\nI'll definitely return every time I visit Paris.",
      "time": 1753473090,
      "translated": false
    },
    {
      "author_name": "Camille Rios",
      "author_url": "https://www.google.com/maps/contrib/105504392564380079188/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocJyzskNDdNCjiqiJHIrkUHttTnkC16kARy7WjGp5HKFOZR0rg=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "in the last week",
      "text": "Big museum with nice art. Building used to be a train station and they converted it into a museum There are 3 floors and stairs are on both ends. There is a restaurant with an outside terrace to take nice pictures from. I'd recommend coming here if you're in the area.",
      "time": 1753194720,
      "translated": false
    },
    {
      "author_name": "Bo Nawacharee",
      "author_url": "https://www.google.com/maps/contrib/113540065532962931652/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUJTV5A1CFWrqpDxBPJJGLnFKs7TFAOTEw5EFsXwm_Q2jPJ0QaL=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "in the last week",
      "text": "I didn’t get the ticket in advance but it was very easy to get in. There was only a few people in front of me at purchase point and no wait to get in.\n\nQuite crowded inside but if you navigate yourself well you can find moments where people passed by and the spots become quiet.\n\nInsane collections. Love love love their pieces. Highly recommend coming here for the Paris visit.\n\nI would plan at least 2 hours for being in here so you dont rush around. It was wonderful!",
      "time": 1753235347,
      "translated": false
    }
  ],
