{"type":"text","text":"{
  "name": "Musée de l'Orangerie",
  "formatted_address": "Jardin des Tuileries, 75001 Paris, France",
  "location": {
    "lat": 48.8637884,
    "lng": 2.3226724
  },
  "formatted_phone_number": "01 44 50 43 00",
  "website": "https://www.musee-orangerie.fr/fr",
  "rating": 4.6,
  "reviews": [
    {
      "author_name": "Bo Nawacharee",
      "author_url": "https://www.google.com/maps/contrib/113540065532962931652/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUJTV5A1CFWrqpDxBPJJGLnFKs7TFAOTEw5EFsXwm_Q2jPJ0QaL=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "Highly recommend buying ticket with time slot in advance!\n\nOne of the most beautiful museums in Paris. Definitely a must visit, very elegant, peaceful, and gorgeous.\n\nThe wait could take up to 1-2 hours on a normal weekday around 11-12pm. If you know your plan, I highly recommend book the time slot in advance.\n\nI wish they limit or organise visitors a little more strictly. Sometimes there were too many people in the oval rooms and it was very hard to look or appreciate the painting with time or concentration.\n\nOther exhibition downstair was also wonderful! Great selections.",
      "time": 1752938865,
      "translated": false
    },
    {
      "author_name": "Ching-Yen CHENG",
      "author_url": "https://www.google.com/maps/contrib/103370993927902045533/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUX1Wf0H6riDBfoXEPsHrzKjqDYB3acC7E0Q--EA2i8ZrjsM8Uc=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "2 months ago",
      "text": "Beautiful water Lily from Monet. Other collections about painters of Impressionism are also worth a visit. I loved the collection of Renoir before. Now they have a small family room for little kids to appreciate paintings by small games. Very recommended.",
      "time": 1746376072,
      "translated": false
    },
    {
      "author_name": "Rong Mao",
      "author_url": "https://www.google.com/maps/contrib/116804457542780207646/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXPcyjHoGambkzj9DVyECt5gonRMNLTU5UGFwdDXJkqrk7JextayA=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "A very nice, unique museum where the very large, impressive Claude Monet’s water lilies masterpieces are displayed. Monet spent many years painting these water lilies and ponds for meditation. The museum also has other exhibitions and is not too big. One can finish the tour in half a day.",
      "time": 1752984537,
      "translated": false
    },
    {
      "author_name": "deniz alaaddinoğlu",
      "author_url": "https://www.google.com/maps/contrib/111507651790694434401/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUFkc57It-CRT4jJdIKZMy8f9qCxH3vJXorHovnGzjaKkh8NsX6=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "2 months ago",
      "text": "This was hands down my favorite museum in Paris. I didn’t even have to wait in line to get in—maybe I just got lucky, but it made the experience even better! The highlight was, without a doubt, Monet’s Water Lilies. Standing in those oval rooms surrounded by his massive, serene paintings was absolutely breathtaking. The atmosphere was calm, the layout beautifully curated, and the overall experience unforgettable. I 100% recommend visiting—especially if you appreciate impressionist art or just want a peaceful, inspiring break from the city buzz. If you are a student the museum is free.",
      "time": 1748520712,
      "translated": false
    },
    {
      "author_name": "Aydan Mammadzada",
      "author_url": "https://www.google.com/maps/contrib/101248899781161450035/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXxcPiV7Ez2x72Q6aozJpzDZVISFprJelTzpcHbi5OxL0QZYYYv7w=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "full of Monet's Water Lilies and other amazing artworks! we went without paying any money, if you are under 25 and have a citizenship or visa or residency permit in EU countries, you could visit free this museum. it is always better to check and we got free tickets beforehand. highly recommended!!! there was a huge line in both ways where people had and did not have tickets, but at least when you have tickets queue is going easily.",
      "time": 1749945634,
      "translated": false
    }
