{"type":"text","text":"{
  "name": "Arc de Triomphe",
  "formatted_address": "Pl. Charles de Gaulle, 75008 Paris, France",
  "location": {
    "lat": 48.8737917,
    "lng": 2.2950275
  },
  "formatted_phone_number": "01 55 37 73 77",
  "website": "https://www.paris-arc-de-triomphe.fr/",
  "rating": 4.7,
  "reviews": [
    {
      "author_name": "Ivan Tan",
      "author_url": "https://www.google.com/maps/contrib/117991758272607395005/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVQN1wJ5Ewsincc-Xu-JNLsgh6U1zdgI6-dyxiQ-9Wo-2GDD_dB=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "Visited the Arc de Triomphe early in the morning and it was 100% worth it. As soon as you exit the metro (Line 1 – Charles de Gaulle-Étoile station), you’ll pretty much see it right in front of you. Super easy to find, which was great because I didn’t want to waste time getting lost first thing in the morning.\n\nGetting there early was the best decision, barely any crowds and the lighting supposed to be great for photos (sadly it was a rainy day). If you’re into photography, this is the time to go. I managed to get some shots without people photobombing every picture.\n\nThe monument itself is huge and super detailed, way more impressive up close than I expected. You can walk around the base and really take in all the carvings and statues. I didn’t go up to the top this time but I’ve heard the view is amazing, especially at sunrise or sunset.\n\nThere’s also a little memorial underneath with an eternal flame, which is really touching and gives a sense of the history behind the place. Cars are constantly driving around the circle.\n\nit’s a must-see if you’re in the city. Easy access, great photo ops, and just an iconic Paris experience. :)",
      "time": 1750755342,
      "translated": false
    },
    {
      "author_name": "Zeba Darvesh",
      "author_url": "https://www.google.com/maps/contrib/100348519064445971247/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWtqfeU-FHTnoyIgNqnoOBHNEEu8owU00pyP2n99VVhA7_tsU2l_A=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "a month ago",
      "text": "Located just a few steps away from the nearest metro station, it’s incredibly accessible and easy to reach—perfect for anyone exploring the city by public transport. Unfortunately, we arrived a little too late to purchase tickets for access to the top, which was a slight disappointment. Massive scale, intricate carvings, and historical significance are inspiring. You can get a great view and stunning photographs from the pedestrian pathway located directly across from the Arc.",
      "time": 1750358742,
      "translated": false
    },
    {
      "author_name": "Nika Shlopov",
      "author_url": "https://www.google.com/maps/contrib/111785032988713295331/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVsVlbKDgNky6BSE7ZMUDtfkHlDEfG3pCQwBu9JlhlcBGhBmlFrCA=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "Gorgeous view of Paris. 100% get tickets in advance avoid waiting in the hot sun in a long line. Got tickets 3 ish weeks in advance and there was no line for ticket holders to get to the top! If I did it again I would go at sunset for a more gorgeous view and better lightning for photos.",
      "time": 1753033012,
      "translated": false
    },
    {
      "author_name": "Crisandra De Sousa",
      "author_url": "https://www.google.com/maps/contrib/113178977166665376002/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocKllouBjr7naf2JC8Fr_r666bYUKuD7SIOwxqlRKCG18JCNew=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "in the last week",
      "text": "The Arc is massive and a great monument to see, it’s an amazing tribute to the many soldiers that have been in battle, generals and so on who have died, and the unknown soldiers. Great views from the top of all of Paris, worth the ticket price to go up. No ticket needed to go at the bottom, walk around and take pictures.",
      "time": 1753255810,
      "translated": false
    },
    {
      "author_name": "noel medina",
      "author_url": "https://www.google.com/maps/contrib/100767118087011667894/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVMwT6kMBkZx0OnInUSCxibPe7L5_BnjvfFfLbcucOhRHid7DhP=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 4,
      "relative_time_description": "2 weeks ago",
      "text": "Stopped by the Arc de Triomphe while wandering the Champs and honestly, even without climbing up, it’s a cool stop.\n\nThe massive arches and detailed carvings are super impressive up close, and watching the cars somehow not crash in that crazy roundabout is weirdly fun.\n\nIt gets busy, but it’s worth it, especially if you catch it at golden hour when everything looks extra pretty.\n\nWe didn’t bother with the stairs this time and still got that “yep, I’m in Paris” feeling just standing there, grabbing a few photos, and taking in the vibe. Tourist spot for sure, but one that’s actually worth a look.",
      "time": 1752103489,
      "translated": false
    }
  ],
