{"type":"text","text":"{
  "name": "Eiffel Tower",
  "formatted_address": "Av. Gustave Eiffel, 75007 Paris, France",
  "location": {
    "lat": 48.85837009999999,
    "lng": 2.2944813
  },
  "website": "https://www.toureiffel.paris/fr",
  "rating": 4.7,
  "reviews": [
    {
      "author_name": "Alper Öner",
      "author_url": "https://www.google.com/maps/contrib/103712379416621590034/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXAzoBN0FLwBMz9YYSqEvwM6rZDsmJeFmj1jOnmkMBLvgNkxSC6=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "2 weeks ago",
      "text": "Seeing the Eiffel Tower up close was amazing, even without going to the top! The size and elegance of the tower are truly impressive in person, and just walking around it made me feel the special atmosphere of Paris. The area is lively, with people taking photos, relaxing on the lawns, and enjoying the view. Watching the tower sparkle at night was a real highlight. It felt magical. Honestly, you don’t need to go up to appreciate how iconic and beautiful the Eiffel Tower is. Just being there and soaking in the vibe was a wonderful experience!",
      "time": 1752303584,
      "translated": false
    },
    {
      "author_name": "Douglas Shin",
      "author_url": "https://www.google.com/maps/contrib/107572007472804734737/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXR0BaGFx98iLcsuZiPq74timJnfshLfX0g8i_WT8Y02kXsCFaa=s128-c0x00000000-cc-rp-mo-ba6",
      "rating": 5,
      "relative_time_description": "3 weeks ago",
      "text": "*Paris Symbol, The World's Beloved Eiffel*\nThe Eiffel Tower is more than just a monument—it's the heart of Paris and one of the most recognizable structures in the world. Seeing it in person for the first time truly takes your breath away, whether it's by day with the blue sky as a backdrop or at night when it sparkles with thousands of lights. I had always seen photos and heard stories about it, but witnessing the Eiffel Tower with my own eyes was a completely new experience. The view from afar is impressive, but seeing it up close is entirely different. I could clearly see people climbing the stairs and others going up by elevator, and the intricate ironwork of the structure fascinated me. The tower's design is truly romantic and a masterpiece of architecture.\nA bit of history makes it even more fascinating: The Eiffel Tower was designed by the French engineer Gustave Eiffel and built for the 1889 Exposition Universelle (World's Fair), held to celebrate the 100th anniversary of the French Revolution. At the time, it was the tallest structure in the world and a symbol of French engineering and innovation. Interestingly, many Parisians initially disliked the tower, calling it an eyesore—but today, it's one of the most beloved landmarks on the planet.\nWhat made this visit even more special was celebrating our 25th wedding anniversary here. I felt deeply grateful that my wife and I could share this meaningful moment together at such an iconic place. I sincerely hope this beautiful memory stays with us forever.",
      "time": 1751431129,
      "translated": false
    },
    {
      "author_name": "Carlos Capitillo",
      "author_url": "https://www.google.com/maps/contrib/114568511803070671597/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjX00s83MP2I3la4JNyH5wJx8yEQyUUZdfqD9NKFTauLsWUyPxCi=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "a week ago",
      "text": "Eiffel Tower: An Iconic Ascent with Unforgettable Views!\nThe Eiffel Tower is an absolute stunning masterpiece, and going up was a highlight of my trip! The views from the second floor were breathtaking, offering a panoramic perspective of Paris that was truly captivating.\nOpting for a private tour with skip-the-line access was incredibly valuable, as the regular queue appeared to be quite extensive. We went right up, maximizing our time at the top. After coming down, there was still plenty of time to capture some wonderful pictures from the ground, ensuring I had lasting memories.\nThis is definitely a place you must visit when in Paris!",
      "time": 1752668747,
      "translated": false
    },
    {
      "author_name": "Gurvinder Singh",
      "author_url": "https://www.google.com/maps/contrib/106842880547863630824/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVSy5vGApjClxQ-A4iqdnc7fZ2PZvK3RzMuQDgEvXC5dV9DFAlpVg=s128-c0x00000000-cc-rp-mo-ba5",
      "rating": 5,
      "relative_time_description": "in the last week",
      "text": "An amazing experience and site. If you can, go at night to experience the lights and the glimmering of them, which occurs past sunset. Take the cruise on the Sienne, which allows you to take in the breathtaking views all around you. Take a walk around the site as well and, of course, the tour to take up the elevator and get a glimpse of Paris from up top.",
      "time": 1753263764,
      "translated": false
    },
    {
      "author_name": "Crisandra De Sousa",
      "author_url": "https://www.google.com/maps/contrib/113178977166665376002/reviews",
      "language": "en",
      "original_language": "en",
      "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocKllouBjr7naf2JC8Fr_r666bYUKuD7SIOwxqlRKCG18JCNew=s128-c0x00000000-cc-rp-mo-ba4",
      "rating": 5,
      "relative_time_description": "in the last week",
      "text": "Great site to see, very beautiful at night with the lights and then every hour after 10 pm it twinkles for 5 min, starts right at 10 Pm.\nGot the ticket to go up to the two lower levels, great views, lots of space for pictures, can see all 4 sides of the city. Can see the river and many of the other sites in Paris. For sure must see. Spend an evening from 7pm till 10:30 at the park with a view of the tower, picnic with some wine and great view.\nIf you are planning to do the picnic buy food, snacks at near by small grocery stores, buy wine there as well, much cheaper then buying from street vendors.\nAlso bring a blanket, grass is often wet, bring a cork/ bottle opener, some glasses and enjoy.",
      "time": 1753255526,
      "translated": false
    }
  ],
